import React, { Component } from 'react';

class PagePrincipale extends Component{
    constructor(props){
        super(props);
    }

    render(){
        return(
        <h1>Ensemble
            <form>
                <button type = "button"> S'inscrire</button>
                <button type = "button"> Connection</button>
            </form>
        </h1>)
    }
}

export default PagePrincipale;
